package com.polarbear.sep303.uc;

public class UCResult {

	private String c1;
	private int n1;
	private String c2;
	private int n2;
	
	public UCResult() {
		// TODO Auto-generated constructor stub
	}

	public UCResult(String c1, int n1, String c2, int n2) {
		super();
		this.c1 = c1;
		this.n1 = n1;
		this.c2 = c2;
		this.n2 = n2;
	}

	public String getC1() {
		return c1;
	}

	public void setC1(String c1) {
		this.c1 = c1;
	}

	public int getN1() {
		return n1;
	}

	public void setN1(int n1) {
		this.n1 = n1;
	}

	public String getC2() {
		return c2;
	}

	public void setC2(String c2) {
		this.c2 = c2;
	}

	public int getN2() {
		return n2;
	}

	public void setN2(int n2) {
		this.n2 = n2;
	}

}
